import Checklist from "./Checklist";

export default function DevFrontend() {
    //state

    //comportement

    return (
        <div className="DevFrontend">
            <h2 className="fw-bold text-capitalize" style={{fontFamily: "Chakra Petch, sans-serif"}}>
                DÃ©veloppement Web
            </h2>
            <div className="d-flex">
                <div>
                    <Checklist title="Design front-end" descriptions="html | css | javascript - React"/>
                    <Checklist title="Responsive" descriptions="Bootstrap"/>
                </div>
            </div>
            <div style={{position: "absolute", top: 125, left: "25%"}}>
                <img src={Mac} alt="#" width={1200}/>
            </div>
        </div>
    )
};
